       // 弹出 panel\n            this.createPanel($linkElem.text(), $linkElem.attr('href'))\n        } else {\n            // 菜单未被激活，说明选区不在链接里\n            if (editor.selection.isSelectionEmpty()) {\n                // 选区是空的，未选中内容\n                this.createPanel('', '')\n            } else {\n                // 选中内容了\n                this.createPanel(editor.selection.getSelectionText(), '')\n            }\n        }\n    }\n\n    /**\n     * 创建 panel\n     * @param text 文本\n     * @param link 链接\n     */\n    private createPanel(text: string, link: string): void {\n        const conf = createPanelConf(this.editor, text, link)\n        const panel = new Panel(this, conf)\n        panel.create()\n    }\n\n    /**\n     * 尝试修改菜单 active 状态\n     */\n    public tryChangeActive() {\n        const editor = this.editor\n        if (isActive(editor)) {\n            this.active()\n        } else {\n            this.unActive()\n        }\n    }\n}\n\nexport default Link\n"]},_coverageSchema:"1a1c01bbd47fc00a2c39e90264f33305004495a9",hash:"585507f6b7ba53420fc6a5808b57b6dd572251fc"},l=t[i]||(t[i]={});l[e]&&l[e].hash===n||(l[e]=o);var r=l[e];return a=function(){return r},r}a();var s=(a().s[0]++,void a().b[0][0]++&&(a().b[0][1]++,(void 0).__extends)||(a().b[0][2]++,function(){a().f[0]++,a().s[1]++;var e=function(n,t){return a().f[1]++,a().s[2]++,a().b[1][0]++,e=r["default"]||(a().b[1][1]++,{__proto__:[]}instanceof Array&&(a().b[1][2]++,function(e,n){a().f[2]++,a().s[3]++,e.__proto__=n}))||(a().b[1][3]++,function(e,n){for(var t in a().f[3]++,a().s[4]++,n)a().s[5]++,Object.prototype.hasOwnProperty.call(n,t)?(a().b[2][0]++,a().s[6]++,e[t]=n[t]):a().b[2][1]++}),a().s[7]++,e(n,t)};return a().s[8]++,function(n,t){function i(){a().f[5]++,a().s[10]++,this.constructor=n}a().f[4]++,a().s[9]++,e(n,t),a().s[11]++,n.prototype=null===t?(a().b[3][0]++,(0,l["default"])(t)):(a().b[3][1]++,i.prototype=t.prototype,new i)}}())),A=(a().s[12]++,void a().b[4][0]++&&(a().b[4][1]++,(void 0).__importDefau