// 返回 true，表示执行完之后，隐藏 tooltip。否则不隐藏。\n                    return true\n                },\n            },\n            {\n                $elem: $('<span>30%</span>'),\n                onClick: (editor: Editor, $node: DomElement) => {\n                    $node.attr('width', '30%')\n                    $node.removeAttr('height')\n\n                    // 返回 true，表示执行完之后，隐藏 tooltip。否则不隐藏。\n                    return true\n                },\n            },\n            {\n                $elem: $('<span>50%</span>'),\n                onClick: (editor: Editor, $node: DomElement) => {\n                    $node.attr('width', '50%')\n                    $node.removeAttr('height')\n\n                    // 返回 true，表示执行完之后，隐藏 tooltip。否则不隐藏。\n                    return true\n                },\n            },\n            {\n                $elem: $('<span>100%</span>'),\n                onClick: (editor: Editor, $node: DomElement) => {\n                    $node.attr('width', '100%')\n                    $node.removeAttr('height')\n\n                    // 返回 true，表示执行完之后，隐藏 tooltip。否则不隐藏。\n                    return true\n                },\n            },\n        ]\n\n        tooltip = new Tooltip(editor, $node, conf)\n        tooltip.create()\n    }\n\n    /**\n     * 隐藏 tooltip\n     */\n    function hideImgTooltip() {\n        // 移除 tooltip\n        if (tooltip) {\n            tooltip.remove()\n            tooltip = null\n        }\n    }\n\n    return {\n        showImgTooltip,\n        hideImgTooltip,\n    }\n}\n\n/**\n * 绑定 tooltip 事件\n * @param editor 编辑器实例\n */\nexport default function bindTooltipEvent(editor: Editor) {\n    const { showImgTooltip, hideImgTooltip } = createShowHideFn(editor)\n\n    // 点击图片元素是，显示 tooltip\n    editor.txt.eventHooks.imgClickEvents.push(showImgTooltip)\n\n    // 点击其他地方，或者滚动时，隐藏 tooltip\n    editor.txt.eventHooks.clickEvents.push(hideImgTooltip)\n    editor.txt.eventHooks.keyupEvents.push(hideImgTooltip)\n    editor.txt.eventHooks.toolbarClickEvents.push(hideImgTooltip)\n    editor.txt.eventHooks.menuClickEvents.push(hideImgTooltip)\n    editor.txt.eventHooks.textScrollEvents.push(hideImgTooltip)\n    editor.txt.eventHooks.imgDragBarMouseDownEvents.push(hideImgTooltip)\n\n    // change 时隐藏\n    editor.txt.eventHooks.changeEvents.push(hideImgTooltip)\n}\n"]},_coverageSchema:"1a1c01bbd47fc00a2c39e90264f33305004495a9",hash:"a7f890fb2f0d66d435ab111e1c2a8f6a9c5e894b"},r=t[i]||(t[i]={});r[e]&&r[e].hash===n||(r[e]=o);var a=r[e];return l=function(){return a},a}l();var r=(l().s[0]++,void l().b[0][0]++&&(l().b[0][1]++,(void 0).__importDefault)||(l().b[0][2]++,function(e){return l().f[0]++,l().s[1]++,l().b[2][0]++,e&&(l().b[2][1]++,e.__esModule)?(l().b[1][0]++,e):(l().b[1][1]++,{default:e})}));l().s[2]++,(0,o["default"])(n,"__esModule",{value:!0});var a=(l().s[3]++,r(t(2))),s=(l().s[4]++,r(t(43)));function A(e){var n;function t(t){l().f[2]++;var i=(l().s[5]++,[{$elem:a["default"]("<span class='w-e-icon-trash-o'></span>"),onClick:function(e,n){return l().f[3]++,l().s[6]++,e.selection.createRangeByElem(n),l().s[7]++,e.selection.restoreSelection(),l().s[8]++,e.cmd["do"]("delete"),l().s[9]++,!0}},{$elem:a["default"]("<span>30%</span>"),onClick:function(e,n){return l().f[4]++,l().s[10]++,n.attr("width","30%"),l().s[11]++,n.removeAttr("height"),l().s[12]++,!0}},{$elem:a["default"]("<span>50%</span>"),onClick:function(e,n){return l().f[5]++,l().s[13]++,n.attr("width","50%"),l().s[14]++,n.removeAttr("height"),l().s[15]++,!0}},{$elem:a["default"]("<span>100%</span>"),onClick:function(e,n){return l().f[6]++,l().s[16]++,n.attr("width","100%"),l().s[17]++,n.removeAttr("height"),l().s[18]++,!0}}]);l().s[19]++,n=new s["default"](e,t,i),l().s[20]++,n.create()}function i(){l().f[7]++,l().s[21]++,n?(l().b[3][0]++,l().s[22]++,n.remove(),l().s[23]++,n=null):l().b[3][1]++}return l().f[1]++,l().s[24]++,{showImgTooltip:t,hideImgTooltip:i}}function c(e){l().f[8]++;var n=(l().s[25]++,A(e)),t=(l().s[26]++,n.showImgTooltip),i=(l(